  height: 73mm;
  border: 1mm solid black;

}

.set {

  line-height: 16mm;
}

.set:nth-last-child(8):first-child, 
.set:nth-last-child(8):first-child ~ .set {

.set-symbol {

}

.set-name {

  text-align: center;
}

.set-name img {
